INSERT INTO `sp_sys_config` VALUES ('1', 'web_name', '站点名称', '森普智慧党建云平台', 'text', 'basic', '201803020002', null, '2018-12-19 14:27:14', null, '山东森普针对企业的整体业务需求开发出P5系列产品，该产品主要管理为了实现整个公司业务的一体化管理，整合了OA办公管理、商品进销存管理、客户管理、财务管理、工作流管理、售后跟踪、HR管理等主要模块。');
INSERT INTO `sp_sys_config` VALUES ('2', 'web_url', '链接地址', 'http://dangjian.sp11.cn', 'text', 'basic', '201803020002', null, '2018-12-19 14:27:14', null, null);
