INSERT INTO `sp_sys_config` VALUES ('4', 'web_version', '版本', 'v2.3', 'text', 'basic', '201803020002', null, '2018-12-19 14:27:14', null, null);
INSERT INTO `sp_sys_config` VALUES ('5', 'web_description', '站点简介', '“智慧党建”信息化云平台是经过我们多年的客户调研和开发经验设计出的以一体化操作为核心，整合党建门户、便民服务大厅、党员学习平台、党员工作平台、党建微信等功能体系，帮助实现各级党委的同意平台，让各级党组织、流动党员、基层党员统一管理，提高党建工作整体运作效率，规范党建工作流程，提升人民群众的满意度的信息化平台。    								    								    								    								    								    								    								', 'textarea', 'basic', '201803020002', null, '2018-12-19 14:27:14', null, null);
INSERT INTO `sp_sys_config` VALUES ('6', 'web_keywords', '站点关键字', '森普软件,定制开发,山东森普,APP开发,济南软件公司,济南软件开发,济南APP开发,济南手机客户端开发,济南管理软件,山东APP开发,O2O解决方案,O2O软件,电子商务解决方案,网上商城系统', 'textarea', 'basic', '201803020002', null, '2018-12-19 14:27:14', null, null);
